import React, { useState, useRef } from 'react';

import styles from './tweet_list.module.css';

const Tweet_list = (props) => {
    const [hover, setHover] = useState('tweet')

    const render_List= () => {
        switch (hover) {
            case 'tweet':
                return (
                <div className={styles.bg_hover}>
                    <div>트윗</div>
                </div>
            )
        
            default:
                break;
        }
    }
    return(
        <div className={styles.tweet_list}>
            <div className={styles.bg_hover}>
                <div>트윗</div>
            </div>
            <div className={styles.bg}>
                <div>트윗 및 답글</div>
            </div>
            <div className={styles.bg}>
                <div>미디어</div>
            </div>
            <div className={styles.bg}>
                <div>마음에 들어요</div>
            </div>
        </div>
    )
};

export default Tweet_list;
